import React from 'react';
import './list.js';
import App from './App';
import '.card.js';

function listTemp() {
    let header = "List Header";
    let cards = [
        {title}, {title},
        {content}, {content}
    ];

    return (
    <section class="List">
        <header class="List-header">
            <h2>{listTitle}</h2>
        </header>
        <div class="List-cards">
            {cardTemp}
        </div>
    </section>
    );
  }

  //do we .map here?

  export default App;
